import './App.css';
import Video from './pages/Video';

function App() {
  return (
    <div className="App">
      <div className='app_videos'>
        <Video 
          likes={300}
          messages={600}
          shares={900}
          name="Gabriel"
          description="Gato goleiro"
          music="Musica épica"
          url='https://firebasestorage.googleapis.com/v0/b/jornada-b5e9d.appspot.com/o/brecker2.mp4?alt=media&token=9aa979e9-0907-4093-abd5-a71efe4fc946'
        />
        <Video 
          likes={300}
          messages={600}
          shares={900}
          name="Gabriel Teles"
          description="Gabriel meu amorzin"
          music="Love Love"
        />
        <Video 
          likes={300}
          messages={600}
          shares={900}
          name="Gabriel Medeiros"
          description="Gabriel Gato"
          music="Musica épica"
        />

      </div>
    </div>
  );
}

export default App;
